declare namespace org {
    namespace springframework {
        namespace jmx {
            namespace export$ {
                namespace annotation {
                    /**
                     * Type-level annotation that indicates JMX notifications emitted by a bean,
                     * containing multiple {@link ManagedNotification ManagedNotifications}.
                     * @author Rob Harrop
                     * @since 2.0
                     */
                    // @ts-ignore
                    abstract class ManagedNotifications implements java.lang.annotation.Annotation {
                    }
                }
            }
        }
    }
}
